@Rello, thats not how it works. Yes, detrimental genes are already in all of us, but incest increases the propensity for genes to be expressed that we don't want and normally would not be expressed in the phenotype. "Externally influencing factors" (epigenetics) have nothing to do with why incest is detrimental for your child. 
 I don't know where you were going with the whole "sex doesn't equal pregnancy" thing. Unless you are infertile, typically sex leads to pregnancy, that's why contraceptives exist. However, contraceptives are not perfect, which is why there is no such thing as "safe sex" despite what some may claim. The more partners you have, the higher chance of contraceptive failure and fluid exchange, which is why after the sexual revolution a lot of people contracted and died from STDs and developed things like cervical cancer that were not as prevalent in the past. Natural selection encourages us to choose our partners wisely and to stick with them.


Also this is fiction.
